import React from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';

import {Link} from 'react-router-dom'

import Homenavs from './homenav';

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
        Your Website and  Your Name Here. 
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    minHeight: '100vh',
  },
  main: {
    marginTop: theme.spacing(8),
    marginBottom: theme.spacing(2),
  },
  footer: {
    padding: theme.spacing(2),
    marginTop: 'auto',
    backgroundColor: 'white',
  },
}));
const useStyles2 = makeStyles({
  card: {
    minWidth: 275,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});

const useStyles3 = makeStyles(theme => ({
  button: {
    margin: theme.spacing(1),
  },
  input: {
    display: 'none',
  },
}));

export default class Home {
  constructor(){
    this.props = {
      classes : useStyles(),
      classes2 : useStyles2(),
      classes3 : useStyles3()
    }

  }
  render(){
    return (
      <div className={this.classes.root}>
        <Homenavs/>
        <Container component="main" className={this.classes.main} maxWidth="sm">
        <Card className={classes2.card}>
        <CardContent>
          <Typography className={classes2.title} color="textSecondary" gutterBottom>
            Admin
          </Typography>
          <Typography variant="h5" component="h2">
            Click below button to go for admin login
          </Typography>
          <Typography className={classes2.pos} color="textSecondary">
            admin login / registration
          </Typography>
          <Typography variant="body2" component="p">
            if you have admin account then login otherwise create your account
            <br />
            {'"Welcome Here"'}
          </Typography>
        </CardContent>
        <CardActions>
        <Button variant="outlined" color="primary" className={classes3.button}>
          Admin Login
        </Button> 
        </CardActions>
      </Card>
        </Container>

        <Container component="main" className={classes.main} maxWidth="sm">
        <Card className={classes2.card}>
        <CardContent>
          <Typography className={classes2.title} color="textSecondary" gutterBottom>
            User
          </Typography>
          <Typography variant="h5" component="h2">
            Click below button to go for user login
          </Typography>
          <Typography className={classes2.pos} color="textSecondary">
            user login / registration
          </Typography>
          <Typography variant="body2" component="p">
            if you have user account then login otherwise create your account
            <br />
            {'"Welcome Here"'}
          </Typography>
        </CardContent>
        <CardActions>
        <Button variant="outlined" color="primary" className={classes3.button}>
          User Login
        </Button>      
        </CardActions>
      </Card>
        </Container>

        <Container component="main" className={classes.main} maxWidth="sm">
        <Card className={classes2.card}>
        <CardContent>
          <Typography className={classes2.title} color="textSecondary" gutterBottom>
            About
          </Typography>
          <Typography variant="h5" component="h2">
            Click below button to check what we are
          </Typography>
          <Typography className={classes2.pos} color="textSecondary">
            about us / contact us
          </Typography>
          <Typography variant="body2" component="p">
            If you wanna know about us and contact info 
            <br />
            {'"Welcome Here"'}
          </Typography>
        </CardContent>
        <CardActions>
        <Button variant="outlined" color="primary" className={classes3.button}>
          About Us
        </Button>      
        </CardActions>
      </Card>
        </Container>


        <CssBaseline />
        <Container component="main" className={classes.main} maxWidth="sm">
        </Container>
        <footer className={classes.footer}>
          <Container maxWidth="sm">
            <Copyright/>
          </Container>


        </footer>
      </div>
    );
  }

}
